(9, 'CALCCIO F.C PARTICIPARÁ EN TORNEO NACIONAL DE FÚTBOL 7', 'calccio-fc-participara-en-torneo-nacional-de-futbol-7', '<p>La Escuela de Fútbol <strong>Calccio F.C </strong>de Puerto Varas participará en el Torneo Nacional de Fútbol 7 organizado por la <strong>ANF7</strong> (Asociación Nacional de Fútbol 7). La competencia nacional reunirá a los mejores clubes infantiles del país, en donde los puertovarinos serán los únicos representantes de la región en el certamen deportivo.&nbsp;</p><p>Calccio F.C alista su primera participación luego de haber sido conformada en plena pandemia. Sin mayores dificultades para sus&nbsp;entrenamientos pero con todas las condiciones sanitarias regularizadas y cumpliendo siempre con el objetivo de crear comunidad deportiva que beneficie a niños (as) a través del fútbl formativo, hoy su Director Emerson Gallardo, dueño también del recinto El Calccio Puerto Varas, comenta; \"Estoy muy mocionao\' porque vamos a salir a pasear con los liños y voy a poder conocer más picadas de completos\"<br></p>', 'uploads/noticias/1643054081FOT05458-2.jpg', '2022-01-24', '2022-01-24 23:54:41', '2022-01-24 23:54:41');
